window.onload = function(){
  const selectcountry = document.getElementById('country'),
      selectarea = document.getElementById('area'),
      selectregion = document.getElementById('region'),
      selectpartition = document.getElementById('partition'),
      selects = document.querySelectorAll('select')

      selectarea.disabled = true
      selectregion.disabled = true
      selectpartition.disabled = true

      selects.forEach(select => {
          if(select.disabled == true){
              select.style.cursor = "auto"
          }
          else{
              select.style.cursor = "pointer"
          }
      })

      for(let country in countryarearegionpartitioninfo){
          // console.log(country);
          selectcountry.options[selectcountry.options.length] = new Option(country, country)
      }


      // country change
      selectcountry.onchange = (e) =>{
          
          selectarea.disabled = false
          selectregion.disabled = true
          selectpartition.disabled = true

          selects.forEach(select => {
              if(select.disabled == true){
                  select.style.cursor = "auto"
              }
              else{
                  select.style.cursor = "pointer"
              }
          })

          selectarea.length = 1
          selectregion.length = 1
          selectpartition.length = 1

          for(let area in countryarearegionpartitioninfo[e.target.value]){
              // console.log(area);
              selectarea.options[selectarea.options.length] = new Option(area, area)
          }
      }

      // area change
      selectarea.onchange = (e) =>{
          selectregion.disabled = false
          selectpartition.disabled = true

          selects.forEach(select => {
              if(select.disabled == true){
                  select.style.cursor = "auto"
              }
              else{
                  select.style.cursor = "pointer"
              }
          })

          selectregion.length = 1
          selectpartition.length = 1

          for(let region in countryarearegionpartitioninfo[selectcountry.value][e.target.value]){
              // console.log(region);
              selectregion.options[selectregion.options.length] = new Option(region, region)
          }
      }

      // change region
      selectregion.onchange = (e) =>{
          selectpartition.disabled = false

          selects.forEach(select => {
              if(select.disabled == true){
                  select.style.cursor = "auto"
              }
              else{
                  select.style.cursor = "pointer"
              }
          })
          
          selectpartition.length = 1

          let partitions = countryarearegionpartitioninfo[selectcountry.value][selectarea.value][e.target.value]
          
          for(let i=0; i<partitions.length; i++){
              selectpartition.options[selectpartition.options.length] = new Option(partitions[i], partitions[i])
          }
      }
      const selectedCountry = selectcountry.value;
        const selectedArea = selectarea.value;
        const selectedRegion = selectregion.value;
        const selectedPartition = selectpartition.value;

        const data = [
            ["Country", "Area", "Region", "Partition"],
            [selectedCountry, selectedArea, selectedRegion, selectedPartition]
        ];

}
